import React, { Component } from 'react';
import { Button, FormGroup, FormControl, Form, Container} from "react-bootstrap";
import { Redirect } from 'react-router-dom'
import { withRouter } from 'react-router-dom'
import axios from 'axios';
import {DragDropContext} from 'react-beautiful-dnd';

const initialData = {
    column: {
      id: 'column-1',
        numberIds: ['four', 'one', 'five', 'three', 'two'],
      },
      numbers: {
        'five': { id: 'five', content: '5' },
        'four': { id: 'four', content: '4' },
        'one': { id: 'one', content: '1' },
        'three': { id: 'three', content: '3' },
        'two': { id: 'two', content: '2' },
      }
};

class Boarding extends Component {
    constructor(props) {
      super(props);

    }
    render() {
        return (
            <DragDropContext>
                {this.state.columnsort.map(columnId => {
                    const column = this.state.columns[columnId];
                    const heroes = column.heroId.map(heroId => this.state.heroes[heroId]);
                    return <Column key={Column.id} column={column} heroes={heroes} />;
                })}
                </DragDropContext>
        )
    }

    onDrop(data) {
        console.log(this)
    }
  }

export default (withRouter)(Boarding)
